export default function ContentHome({ games }) { // přijímáš props 'games'
    return (
        <div className={"lg:px-20 flex flex-row gap-20 contentHome"}>
            <div className={"flex flex-col gap-12"}>
                <InfoPanel className={"infoPanel font-bold"} headline={"Nejoblíbenější ligy"}>
                    <Gap gap={"4"}></Gap>
                    <Link classNameDiv={"flex flex-row-reverse items-center justify-end gap-3"} text={"Premier League"}><img src={"/images/englad.svg"} alt={""}/></Link>
                    <Gap gap={"4"}></Gap>
                    <Link classNameDiv={"flex flex-row-reverse items-center justify-end gap-3"} text={"Premier League"}><img src={"/images/englad.svg"} alt={""}/></Link>
                </InfoPanel>
            </div>
            <div className={"flex flex-col gap-12"}>
                <MatchPanel headline={"Liga Mistrů"} date={"Úterý 20:00"} src={"/images/englad.svg"}>
                    {games.map(game => (
                        <Match
                            key={game.id}
                            time={game.time}
                            team1Img={game.team1Img}
                            team2Img={game.team2Img}
                            team1={game.team1}
                            team2={game.team2}
                            score1={game.score1}
                            score2={game.score2}
                        />
                    ))}
                </MatchPanel>
            </div>
        </div>
    );
}
